">	Если подача производится через операторов почтовой связи общего пользования ценным письмом с заверенной описью вложения по адресу работы приемной комиссии Университета: г. Саранск, ул. Полежаева, 44/3, Учебный корпус № 28, кабинет № 318 – указанные <strong>документы принимаются</strong>, если они поступили в Университет <strong>не позднее срока завершения приема документов</strong>.</p><p><br></p>','text',NULL,56,NULL,'2020-06-26 22:26:44','2020-07-05 18:30:40',NULL),(564,'Индивидуальные достижения','XK5vJ4DRoodHxh3lsbzCAXEYGtBhGzdVcem5nVbD.pdf',0,'Индивидуальные достижения.pdf','file','1og82z1g8diahgnm8emzht',NULL,563,'2020-06-26 22:31:11','2020-06-26 22:31:11','pdf'),(565,'Образец оформления списка публикаций','JGtuS837xNrnlGK2dC17z6OSAplazYC5TieyLoUQ.docx',1,'Образец оформления списка публикаций.docx','file','fbej8kkzsldsb54fm67of',NULL,563,'2020-06-26 22:31:11','2020-06-26 22:31:11','docx'),(508,NULL,NULL,0,NULL,'files',NULL,22,NULL,'2020-06-23 20:01:16','2020-06-23 20:01:16',NULL),(509,'Формирование списка с информацией о количестве поданных заявлений, в том числе списка лиц, подавших заявление','YqvCHA5MS7hpO55HmwNbQ7dwllLECkwwsKcV0jJd.pdf',0,'Формирование списка с информацией о количестве поданных заявлений.pdf','file','eczz1qnfjvm2v97asbws0n',NULL,508,'2020-06-23 20:01:16','2020-06-23 20:01:16','pdf'),(563,NULL,NULL,0,NULL,'files',NULL,76,NULL,'2020-06-26 22:31:11','2020-06-26 22:31:11',NULL),(515,'Особенности организации приема на целевое обучение в аспирантуру','ZDGhgdmaamfpX7yU3n8RL6RmIG1e4HDXErnV5Fh2.pdf',4,'Особенности организации приема на целевое обучение в аспирантуру.pdf','file','fkf7m6awmij37mpd9z8xb7',NULL,46,'2020-06-23 20:46:59','2020-06-25 08:32:49','pdf'),(566,NULL,NULL,0,NULL,'files',NULL,77,NULL,'2020-06-30 12:26:17','2020-06-30 12:26:17',NULL),(560,'Почтовый адрес организации','wnDIHTLXr0TVyjyAKPEBskfn2T6EyhFgAsmnCZci.pdf',9,'Почтовый адрес организации.pdf','file','1ry5ihmxzdhppx705agb8g',NULL,46,'2020-06-26 22:13:59','2020-06-26 22:23:56','pdf'),(516,'Особенности проведения приема иностранных граждан и лиц без гражданства','1sBy8XgJgxrqLvxcfOqEs8bnX39OryfkvO7oRX9y.pdf',5,'Особенности проведения приема иностранных граждан и лиц без гражданства.pdf','file','odp5iuq4jp1quo0kr565r',NULL,46,'2020-06-23 20:50:56','2020-06-25 08:32:47','pdf'),(517,NULL,NULL,0,NULL,'files',NULL,61,NULL,'2020-06-24 06:14:36','2020-06-24 06:14:36',NULL),(518,'Стоимость обучения ординаторов первого года обучения для российских граждан (2020-2021 учебный год)','1iQ8gv8A5XoBBDYLCSi7q4NhPlpZu2q8R9ZYq89H.pdf',0,'Стоимость обучения ординаторов первого года обучения для российских граждан (2020-2021 учебный год).pdf','file','ns47d8nx1vrk7xyi5m77w',NULL,517,'2020-06-24 06:14:36','2020-06-24 06:17:22','pdf'),(519,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год)','pJjX3mfymGq9fmhvqwFx4Bvzj95rTzNFVZiriII9.pdf',1,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год).pdf','file','6kudt32i2v2m3h1ev4r168',NULL,517,'2020-06-24 06:14:36','2020-06-24 06:17:22','pdf'),(520,'Правила приема на обучение по образовательным программам высшего образования – программам ординатуры',NULL,0,NULL,'files',NULL,62,NULL,'2020-06-24 06:24:40','2020-06-24 07:54:14',NULL),(521,'Правила приёма в ординатуру (2020)','mpL7skom0RS8keHrXXq0FQB6tRnEE5OOl5sclRSK.pdf',0,'Правила приема в ординатуру (2020).pdf','file','pnprdidosof467p4l9vnb',NULL,520,'2020-06-24 06:24:40','2020-06-24 07:38:15','pdf'),(522,'',NULL,0,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приема в ординатуру, и иных иностранных граждан, лиц без гражданства.</p>','text',NULL,63,NULL,'2020-06-24 06:27:32','2020-06-24 06:50:35',NULL),(424,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,2,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Для поступления на программы магистратуры поступающий сдает междисциплинарный экзамен по программе соответствующего бакалавриата, которые размещены по ссылке: https://abiturs.mrsu.ru/Magistratura-Normativnie-dokumenti.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p class=\"ql-align-justify\">	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p class=\"ql-align-justify\">	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p class=\"ql-align-justify\">	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p class=\"ql-align-justify\">	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p class=\"ql-align-justify\">	<strong>5.</strong> &nbsp;Ход проведения вступительных испытаний: </p><p class=\"ql-align-justify\">	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p class=\"ql-align-justify\">	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p class=\"ql-align-justify\">	<strong>6.</strong> &nbsp;Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p class=\"ql-align-justify\">	<strong>7.</strong> &nbsp;При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p class=\"ql-align-justify\">	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p class=\"ql-align-justify\">	<strong>8.</strong> &nbsp;В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><p class=\"ql-align-justify\">	– по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </p><p class=\"ql-align-justify\">	– по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</p><p>&nbsp;</p>','text',NULL,51,NULL,'2020-06-19 07:52:38','2020-06-19 07:52:38',NULL),(425,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,3,'<p class=\"ql-align-justify\">	<strong style=\"color: black;\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих). </p><p class=\"ql-align-justify\"><strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения. </span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p class=\"ql-align-justify\">	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление. </span></p><p class=\"ql-align-justify\">	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p class=\"ql-align-justify\">	<strong>5.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p class=\"ql-align-justify\">	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>10 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p class=\"ql-align-justify\">	<strong><u>12 августа в 18.00</u></strong><u>: </u></p><p class=\"ql-align-justify\">	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>13 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p class=\"ql-align-justify\">	в) этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>13 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>13 августа в 18.00: </u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p class=\"ql-align-justify\">	<strong>6.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p class=\"ql-align-justify\">	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>12 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p class=\"ql-align-justify\">	<strong><u>13 августа в 18.00</u></strong><u>: </u></p><p class=\"ql-align-justify\">	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p class=\"ql-align-justify\">	в) этап зачисления по общему конкурсу:</p><p class=\"ql-align-justify\">	<strong><u>14 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p class=\"ql-align-justify\">	<strong><u>14 августа в 18.00: </u></strong></p><p class=\"ql-align-justify\">	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p class=\"ql-align-justify\">	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p class=\"ql-align-justify\">	<strong><u>15 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p class=\"ql-align-justify\">	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам магистратуры &nbsp;по очной, очно-заочной и заочной формам обучения:</p><p class=\"ql-align-justify\">	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>28 августа</u></strong>;</p><p class=\"ql-align-justify\">	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p class=\"ql-align-justify\">	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p class=\"ql-align-justify\">	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p class=\"ql-align-justify\">	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,51,NULL,'2020-06-19 07:53:15','2020-06-19 07:53:15',NULL),(532,'Репетиционный экзамен',NULL,0,'<p>Вступительное испытание проводится в форме тестирования.</p><p>Пройти репетиционное тестирование можно на сайте Методического центра аккредитации.</p><p>Количество попыток не ограничено.</p><p><br></p><p>Комплектование набора тестовых заданий осуществляется программным обеспечением из единой базы оценочных средств.</p><p><br></p><p>Перед прохождением репетиционного экзамена ознакомьтесь с&nbsp;<a href=\"https://fmza.ru/upload/medialibrary/0e1/instruktsiya-re_obnovl.26.03.2018-g..pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Инструкцией</a>.</p><p><br></p><p><a href=\"https://selftest.mededtech.ru/\" rel=\"noopener noreferrer\" target=\"_blank\">РЕПЕТИЦИОННЫЙ ЭКЗАМЕН</a></p>','text',NULL,67,NULL,'2020-06-24 06:45:16','2020-06-24 06:45:16',NULL),(530,'',NULL,1,NULL,'files',NULL,65,NULL,'2020-06-24 06:36:58','2020-06-24 06:36:58',NULL),(531,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении','erfKzNsh9G02OdWC5LgTwdOVydhbpop5o1smOsFa.pdf',0,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении.pdf','file','72uisjoiirwclzqqy4j0fm',NULL,530,'2020-06-24 06:36:58','2020-06-24 06:36:58','pdf'),(533,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру',NULL,1,NULL,'files',NULL,67,NULL,'2020-06-24 06:46:25','2020-06-24 06:46:25',NULL),(534,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру','yqs5CRkDvy2DmSCIl9CrbwoZUVGMjCgjOE0NkgA6.pdf',0,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру.pdf','file','flhpvzjakj2w6p9x015u5',NULL,533,'2020-06-24 06:46:25','2020-06-24 06:46:25','pdf'),(535,'Сроки проведения вступительных испытаний в ординатуру',NULL,2,'<p><span style=\"color: rgb(73, 78, 83);\">&nbsp;&nbsp;Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места в рамках контрольных цифр приема, завершаются не позднее 11 августа 2020 г. При условии продления приема по основаниям, указанным в п. 3.15 Правил приема в ординатуру, не позднее&nbsp;</span><strong style=\"color: rgb(73, 78, 83);\">26 августа 2020 г</strong><span style=\"color: rgb(73, 78, 83);\">. Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места по договорам об оказании платных образовательных услуг, завершаются не позднее&nbsp;</span><strong style=\"color: rgb(73, 78, 83);\">27 августа 2020 г</strong><span style=\"color: rgb(73, 78, 83);\">.</span></p>','text',NULL,67,NULL,'2020-06-24 06:47:25','2020-06-24 06:47:25',NULL),(536,'Общие правила подачи и рассмотрения апелляций',NULL,3,'<p>&nbsp;1. По результатам решения экзаменационной комиссии о прохождении вступительного испытания поступающий (доверенное лицо) вправе подать в апелляционную комиссию апелляцию о нарушении, по мнению поступающего, установленного порядка проведения вступительного испытания и (или) о несогласии с полученной оценкой результатов вступительного испытания.&nbsp;</p><p><br></p><p>&nbsp;&nbsp;2. Рассмотрение апелляции не является пересдачей вступительного испытания. В ходе рассмотрения апелляции проверяется соблюдение установленного порядка проведения вступительного испытания и (или) правильность оценивания результатов вступительного испытания.</p><p><br></p><p>&nbsp;&nbsp;3. Апелляция подается одним из способов, указанных в п.3.2 настоящих Правил приема в ординатуру.</p><p><br></p><p>&nbsp;&nbsp;4. Апелляция подается в день объявления результатов вступительного испытания или в течение следующего рабочего дня. Рассмотрение апелляций проводится не позднее следующего рабочего дня после дня подачи апелляции.</p><p><br></p><p>&nbsp;&nbsp;5. При рассмотрении апелляции имеют право присутствовать поступающий (доверенное лицо), который должен иметь при себе документ, удостоверяющий его личность.</p><p><br></p><p>&nbsp;&nbsp;6. После рассмотрения апелляции апелляционная комиссия принимает решение об изменении оценки результатов вступительного испытания или оставлении указанной оценки без изменения. Оформленное протоколом решение апелляционной комиссии доводится до сведения, поступающего (доверенного лица). Факт ознакомления, поступающего (доверенного лица) с решением апелляционной комиссии заверяется подписью поступающего (доверенного лица).</p>','text',NULL,67,NULL,'2020-06-24 06:47:54','2020-06-24 06:48:29',NULL),(537,NULL,NULL,0,'<p><span style=\"color: rgb(73, 78, 83);\">Количество мест в общежитиях ФГБОУ ВО «МГУ им. Н.П. Огарёва» для иногородних поступающих в 2020 году - 80 мест.</span></p>','text',NULL,68,NULL,'2020-06-24 06:49:54','2020-06-24 06:49:54',NULL),(540,'',NULL,0,NULL,'files',NULL,70,NULL,'2020-06-24 07:35:02','2020-06-24 07:35:02',NULL),(541,'План целевого приёма в ординатуру в 2020 году','LAt19vpkmDXlpg6WqPfElqaXrjbRXwMhP1tVw9tG.pdf',0,'План целевого приема в ординатуру на 2020 год.pdf','file','bxcw150n75e0zxlcchwdxhq',NULL,540,'2020-06-24 07:35:02','2020-06-24 07:35:02','pdf'),(542,'Детализация целевого приёма','TcPVfj242fA9gq4vcdNvvr6fW7BWtIRbCHWZAkQw.pdf',1,'Детализация целевого приёма.pdf','file','u2tnar6c37mwqliu2q16h8',NULL,540,'2020-06-24 07:35:02','2020-06-24 07:35:02','pdf'),(544,'Условия поступления',NULL,1,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приема в ординатуру, и иных иностранных граждан, лиц без гражданства.</p>','text',NULL,62,NULL,'2020-06-24 07:50:29','2020-06-24 07:50:29',NULL),(543,'Образец договора об оказании платных образовательных услуг','lICuXrZjmpwu8BYVaR9eL43cs4gsNgmyjBBi1XtV.pdf',2,'Договор_ВО.pdf','file','5ram7y2lg3kze1mydswaf',NULL,517,'2020-06-24 07:40:16','2020-06-24 07:40:16','pdf'),(575,'Количество мест для приема на обучение по различным условиям поступления',NULL,2,NULL,'files',NULL,62,NULL,'2020-07-01 20:55:49','2020-07-01 20:55:49',NULL),(576,'Контрольные цифры приёма','vjur5YQat8mZeDPwj6cq6QaAOEHNEgi1AeN0sVLW.pdf',0,'Контрольные цифры приёма (2020).pdf','file','n0zcenuzkeb8i3ipadirt9',NULL,575,'2020-07-01 20:55:49','2020-07-01 20:55:49','pdf'),(577,'План целевого приёма в ординатуру в 2020 году','IyFZV4ZraCmK0dnTmbVP7KPrvUodecWxToAHklos.pdf',1,'План целевого приёма в ординатуру (2020).pdf','file','vxaz8skqyhmtokuii85q2',NULL,575,'2020-07-01 20:59:25','2020-07-01 20:59:25','pdf'),(578,' Детализация целевого приёма','8joAt9ETa20P5nFfPkFvxvX9yW6dBgbpzLPpdgyw.pdf',2,'Детализация целевого приёма.pdf','file','b6n9rk0vmo79pv9dcye1q8',NULL,575,'2020-07-01 20:59:25','2020-07-01 20:59:25','pdf'),(579,'План приёма в ординатуру на платной основе','d36tmbLTylQoYuCCie6Ks8Dxs40f4GAKqcx4xIkb.pdf',3,'Документ.pdf','file','uwviopuox3mrc7kke529nl',NULL,575,'2020-07-01 20:59:25','2020-07-02 05:06:35','pdf'),(581,'Изменения в Правила приёма в ординатуру (2020)','P9f0P8Xole3KRsKvsrAw0Ip8g0YGqciutTQyuyaF.pdf',1,'Изменения в Правила приёма в ординатуру (2020).pdf','file','zi5w5joadwb406h6xqgim',NULL,520,'2020-07-03 20:06:17','2020-07-03 20:06:17','pdf'),(580,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства','SppyaIrB4GkvNg1YEy9tBolfy7cSesWLtlEP1qtr.pdf',4,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства.pdf','file','8brr2ilj44nvesq6hg1p7f',NULL,575,'2020-07-01 21:01:05','2020-07-01 21:01:05','pdf'),(551,'Изменения в Правила приема на обучение по программам подготовки научно-педагогических кадров в аспирантуре','FJuh6dBc9l66iN7DHTFBqi49njtrapVsHYxpudV4.pdf',1,'Изменения в правила приема 2020.PDF','file','zmgqrhho96semuxz01tei8',NULL,46,'2020-06-25 08:31:46','2020-06-25 08:33:00','PDF'),(567,'Памятка абитуриента','OxYACT2yW7eIfVxDyYxbPhNhxZsqKFJEN2oHW60T.pdf',0,'Памятка-бакалавры и специалисты-2020.pdf','file','w1nwbnwp7z0unf2h9sh9a',NULL,566,'2020-06-30 12:26:17','2020-06-30 12:26:17','pdf'),(568,NULL,NULL,1,NULL,'text',NULL,77,NULL,'2020-06-30 12:26:17','2020-06-30 12:26:17',NULL),(569,NULL,NULL,0,NULL,'files',NULL,78,NULL,'2020-06-30 12:27:58','2020-06-30 12:27:58',NULL),(570,'Памятка поступающего','rKUOx7eIbuMbOWEr4AMMXgYJ1BHSFyI7IvaZn020.pdf',0,'Памятка-магистры-2020.pdf','file','57w8mtss37eo5jdhwtvv0o',NULL,569,'2020-06-30 12:27:58','2020-06-30 12:27:58','pdf'),(582,'Электронная форма подачи документов',NULL,0,'<p class=\"ql-align-justify\">С 6 июля 2020 года на сайте университета можно осуществить <strong>электронную подачу документов</strong> для поступления на обучение в аспирантуру: <a href=\"https://p.mrsu.ru/Account/Register\" rel=\"noopener noreferrer\" target=\"_blank\">https://p.mrsu.ru/Account/Register</a></p><p>Поступающий в университет вправе направить заявление на поступление в электронной форме, заполнив форму установленного образца на сайте. После заполнения формы необходимо прикрепить документы, необходимые при подаче (см. выше Порядок приема документов от поступающих). После загрузки и отправки документов на указанный абитуриентом электронный адрес будет выслано письмо для подтверждения. В течение одного рабочего дня сотрудники приемной комиссии проверяют комплект документов на правильность заполнения, наличие всех необходимых документов, согласно Правил приема в ФГБОУ ВО «МГУ им. Н. П. Огарёва» и либо включают абитуриента в списки подавших документы, либо информируют по электронной почте о невозможности включения.</p>','text',NULL,56,NULL,'2020-07-05 18:26:14','2020-07-05 18:35:46',NULL),(2,' ПРАВИЛА ПРИЕМА, УТВЕРЖДЁННЫЕ РЕШЕНИЕМ УЧЕНОГО СОВЕТА УНИВЕРСИТЕТА, НА 2020 ГОД',NULL,0,NULL,'files',NULL,1,NULL,'2020-01-28 13:41:31','2020-05-29 10:48:55',NULL),(462,'Положение о порядке снижения стоимости','B4NJDRIZ0jUIloFxWq0wFXBgEb7pTFT71bQ5WVp2.pdf',3,'Положение о порядке снижения стоимости обучения.pdf','file','zy267kd6vhytggc4n8gf',NULL,432,'2020-06-23 10:12:41','2020-06-23 10:12:41','pdf'),(463,'Положение о порядке снижения стоимости','yX05HUzsUIpfka9Fo1aNRYQ7AQESXT1ZPV5PMxSs.pdf',3,'Положение о порядке снижения стоимости обучения.pdf','file','kefdnbyl41m5fxy3ztwii',NULL,396,'2020-06-23 10:13:14','2020-06-23 10:13:14','pdf'),(10,'ОБ УТВЕРЖДЕНИИ ПЕРЕЧНЯ ОЛИМПИАД',NULL,0,NULL,'files',NULL,5,NULL,'2020-01-31 10:24:04','2020-02-03 06:25:18',NULL),(12,'Перечень олимпиад','bm7rr2pe3zRpARuiHIfmVM20i9MvnkxnB3KlqVFx.pdf',0,'Перечень олимпиад.pdf','file','a06zmrmrdalee3c2vvt3k7',NULL,10,'2020-01-31 10:25:09','2020-02-03 06:25:18','pdf'),(17,'',NULL,0,'<p>В связи с угрозой распространения новой коронавирусной инфекции (COVID-19)&nbsp;«Дни открытых дверей» институтов и факультетов не проводятся. Интересующую информацию можно найти на сайтах институтов и факультетов (раздел «Университет» по <a href=\"https://mrsu.ru/ru/struct/\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>). Также вы можете задать вопросы на адреса электронной почты соответствующих институтов и факультетов или приемной комиссии университета. </p><p><br></p>','text',NULL,3,NULL,'2020-02-03 06:22:28','2020-06-02 14:03:45',NULL),(18,'ОБ УТВЕРЖДЕНИИ ДОПОЛНИТЕЛЬНОГО ПЕРЕЧНЯ ОЛИМПИАД',NULL,1,NULL,'files',NULL,5,NULL,'2020-02-03 06:25:54','2020-02-03 06:25:54',NULL),(19,'Приказ о доп. перечне олимпиад','v9mPOa78ww28fMXiDd5WH0Qb4kbxcXJ9w00Biwgh.pdf',0,'Приказ о доп. перечне олимпиад.pdf','file','suxhyr665aapln3aff2xur',NULL,18,'2020-02-03 06:25:54','2020-02-03 06:25:54','pdf'),(20,'ПОЛОЖЕНИЯ',NULL,2,NULL,'files',NULL,5,NULL,'2020-02-03 06:27:34','2020-02-03 06:27:34',NULL),(21,' По